-- ----------------------------
-- View structure for V_JOB
-- ----------------------------
CREATE OR REPLACE FORCE VIEW "KETTLE_TEST"."V_JOB" AS 
select j.id_job,
       id_directory,
       j.id_job as timing,
       timing as timing_txt,
       name,
       to_char(description) as description,
       to_char(extended_description) as extended_description,
       job_version,
       job_status,
       id_database_log,
       table_name_log,
       created_user,
       created_date,
       modified_user,
       modified_date,
       use_batch_id,
       pass_batch_id,
       use_logfield,
       shared_file,
       run_status,
       last_update,
       auto_restart_num,
       repository_code,
       project_code,
       oorder,
       log_level,
       zlsjc
  from r_job j
  where j.job_status<>0
  /*
  作业视图，默认只显示处于发布状态的作业，可以根据需要自行修改
  */;

-- ----------------------------
-- View structure for V_JOB_PARAMS
-- ----------------------------
CREATE OR REPLACE FORCE VIEW "KETTLE_TEST"."V_JOB_PARAMS" AS 
select ja.id_job,ja.id_job_attribute id,
to_char(ja.value_str) as ocode,
to_char(ja1.value_str) as oname,
to_char(ja2.value_str) as PARAM_DEFAULT,
p.value,p.simple_spell,p.full_spell,p.update_date
from r_job_attribute ja
inner join r_job_attribute ja1 on ja1.id_job=ja.id_job and ja1.nr=ja.nr and ja1.code='PARAM_DESC'
inner join r_job_attribute ja2 on ja2.id_job=ja.id_job and ja2.nr=ja.nr and ja2.code='PARAM_DEFAULT'
inner join r_job j on j.id_job=ja.id_job
left join job_params p on p.id_job=ja.id_job and to_char(ja.value_str)=p.ocode
where ja.code = 'PARAM_KEY'
order by ja.nr asc
/*
参数设置
*/;

-- ----------------------------
-- Function structure for MD5
-- ----------------------------
CREATE OR REPLACE FUNCTION "KETTLE_TEST"."MD5"(in_str IN VARCHAR2)
RETURN VARCHAR2
IS
retval varchar2(32);
BEGIN
retval := utl_raw.cast_to_raw(DBMS_OBFUSCATION_TOOLKIT.MD5(INPUT_STRING => in_str));
--dbms_output.put_line('<'||in_str||'>的MD5:'||retval);
RETURN retval;
END;
/

